import React from "react";
import "../style/home.css";

class HomePage extends React.Component {
  render() {
    return (
      <span className ="center">
        <p className ="label">
          Please enter your address: <input className="address-field"></input>
        </p>
      </span>
    );
  }
}

export default HomePage;
